import React, { useState } from 'react';
import "./SideBar.css";
import logo from "../../Assets/Images/logo/logo.svg";
import {Nav} from "react-bootstrap"


const SideBar = () => {
  const [inactive, setInactive] = useState(false);
  return (
    <div>
      <div className={`side-menu ${inactive ? "inactive" : "" }`}>
         <div className="side-menu__top--section">
           <div className="side-menu__top--section__logo">
             <img src={logo} alt="logo"/>
           </div>
           <div onClick={() => setInactive(!inactive)} className="side-menu__top--section__toggle-menu-arrow">
           {inactive ? <i class="bi bi-arrow-right-circle"></i> : <i class="bi bi-arrow-left-circle"></i>}
           </div>
         </div>
         <div className="side-menu__list">
         <Nav className="me-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#link">Link</Nav.Link>
        <NavDropdown title="Dropdown" id="basic-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown>
      </Nav>
         </div>
      </div>
  </div>
  )

};

export default SideBar;
